import { Injectable } from '@angular/core';
import { CalcLine } from './calc-line';
import { CALC_LINES } from './mock-calcs';

@Injectable({
  providedIn: 'root'
})
export class CalcLineService {

	constructor() { }

	getAll(): CalcLine[] {
		return CALC_LINES;
	}
}
